-- ----------------------------
-- Table structure for yy_list
-- ----------------------------
DROP TABLE IF EXISTS `yy_list`;
CREATE TABLE `yy_list` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `part_id` int(10) NOT NULL DEFAULT '0',
  `name` varchar(20) DEFAULT NULL,
  `age` int(3) DEFAULT NULL,
  `sex` varchar(6) DEFAULT NULL COMMENT '性别',
  `disease_id` varchar(200) DEFAULT '0' COMMENT '病患类型',
  `depart` int(10) DEFAULT '0' COMMENT '科室',
  `is_local` tinyint(1) DEFAULT '1' COMMENT '是否本地病人',
  `area` varchar(32) DEFAULT NULL COMMENT '病人来源地区',
  `tel` varchar(20) DEFAULT NULL,
  `qq` varchar(20) DEFAULT NULL,
  `zhuanjia_num` varchar(10) DEFAULT NULL,
  `content` mediumtext,
  `jiedai` varchar(20) DEFAULT NULL,
  `jiedai_content` mediumtext,
  `order_date` int(10) DEFAULT '0',
  `order_date_changes` int(4) DEFAULT '0' COMMENT '预约时间修改次数',
  `order_date_log` mediumtext,
  `media_from` varchar(20) DEFAULT NULL,
  `engine` varchar(32) DEFAULT NULL,
  `engine_key` varchar(32) DEFAULT NULL,
  `from_site` varchar(40) DEFAULT NULL,
  `from_account` int(10) DEFAULT '0' COMMENT '所属帐户',
  `memo` mediumtext,
  `status` int(2) DEFAULT '0',
  `fee` double(9,2) DEFAULT NULL COMMENT '治疗费用',
  `come_date` int(10) DEFAULT '0',
  `doctor` varchar(32) DEFAULT NULL COMMENT '接待医生',
  `xiaofei` int(2) DEFAULT '0' COMMENT '是否消费',
  `xiangmu` varchar(250) DEFAULT NULL COMMENT '治疗项目',
  `huifang` mediumtext COMMENT '回访记录',
  `rechecktime` int(10) DEFAULT '0' COMMENT '复查时间',
  `addtime` int(10) DEFAULT '0',
  `author` varchar(32) DEFAULT NULL,
  `edit_log` mediumtext COMMENT '修改记录',
  `mtly` varchar(32) DEFAULT NULL,
  `ks` varchar(150) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `part_id` (`part_id`) USING BTREE,
  KEY `order_date` (`order_date`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `addtime` (`addtime`) USING BTREE,
  KEY `author` (`author`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=168 DEFAULT CHARSET=gbk;

